%% LAMBDA 4.0 | Integer Aperture (IA) using Fixed Failure-rate Ratio Test
% This function returns a Fixed Failure-rate Ratio Test (FFRT) coefficient 
% taken from the lookup tables provided in Hou et al. (2016, [RD01]).
%
% -------------------------------------------------------------------------
%_INPUTS:
%   maxFR       Maximum failure rate treshold, in the range [0.05-1%]
%   FR          Failure Rate (0-1)
%   nn          Problem dimensionality
%
%_OUTPUTS:
%   mu_FFRT     Coefficient for the Fixed Failure-rate Ratio Test
%
%_DEPENDENCIES:
%   none
%
%_REFERENCES:
%   [RD01] Hou, Yanqing, Sandra Verhagen, and Jie Wu. 2016. "An Efficient 
%       Implementation of Fixed Failure-Rate Ratio Test for GNSS Ambiguity 
%       Resolution" Sensors 16, no. 7: 945 | DOI: 10.3390/s16070945
%
% -------------------------------------------------------------------------
% Copyright: Geoscience & Remote Sensing department @ TUDelft | 01/06/2024
% Contact email:    LAMBDAtoolbox-CITG-GRS@tudelft.nl
% -------------------------------------------------------------------------
% Created by
%   01/06/2024  - Lotfi Massarweh
%       Implementation for LAMBDA 4.0 toolbox
%
% Modified by
%   dd/mm/yyyy  - Name Surname author
%       >> Changes made in this new version
% -------------------------------------------------------------------------

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% START
%% MAIN FUNCTION
function [mu_FFRT] = computeFFRTcoeff(maxFR,FR,nn)
%--------------------------------------------------------------------------
% Tolerances for the Failure Rate (FR) within the interval [0.05% till 1%]
tolFR = [5e-4:1e-4:9e-4 1e-3:1e-3:9e-3 0.01];
nSteps = length( tolFR );

% Set the maximum dimensionality supported by the current table
if nn > 66
    nn = 66;
end

% Set the maximum Failure Rate within the admissible range
if maxFR < tolFR(1)
    maxFR = tolFR(1);       % Use lower admissible bound

elseif maxFR > tolFR(end)
    maxFR = tolFR(end);     % Use upper admissible bound

end

% Read table data for the mu-coefficient
CoefficientMu = getCoefficientMu;           % Faster than using .mat files

% Retrieve the polynomial terms for Mu at the current dimensionality "nn"
indexDataMu = 4*(0:1:nSteps-1);
dataMu_p1 = CoefficientMu(nn,2+indexDataMu);
dataMu_p2 = CoefficientMu(nn,3+indexDataMu);
dataMu_p3 = CoefficientMu(nn,4+indexDataMu);

% Compute coefficient Mu based on the previous polynomial terms
mu_FFRT_vect = dataMu_p1 .* FR.^dataMu_p2 + dataMu_p3;

% Find the mu-value for the given treshold
if FR > 0.20
    mu_FFRT = 0;
elseif FR >= maxFR
    mu_FFRT = interp1(tolFR,mu_FFRT_vect,maxFR);
    mu_FFRT = max(0,mu_FFRT);
    mu_FFRT = min(1,mu_FFRT);
else
    mu_FFRT = 1;
end

%--------------------------------------------------------------------------
end

